import Orders from "./Orders";
import { useQuery } from "react-apollo";
import { GET_ORDERS } from "../queries/queries";
import { getCheckoutMethod } from "../utils/getCustomAttributes";

const GetOrders = () => {
  // Apollo data
  const { data } = useQuery(GET_ORDERS, {
    pollInterval: 5000,
  });

  console.log("Get Orders", data);

  if(data && data !== undefined) {
    data.orders.edges.map((edge) => {
      const tagsPickupMethod = edge.node.tags.find(method => method === "Pickup Order")
      const tagsDeliveryMethod = edge.node.tags.find(method => method === "Local Delivery Order")
      console.log("TagsPickupMethod", tagsPickupMethod)
      console.log("TagsDeliveryMethod", tagsDeliveryMethod)

      console.log(getCheckoutMethod(edge))
    })
  }


  return (
    <>
      <Orders data={data} />
    </>
  );
};

export default GetOrders;
